import React from "react";
import { useRef } from "react";
import "./contactform.css";
const ContactForm=()=>{
    return(
        <div className="formbox">
        <form className="Contactform" action="#" method="POST">
<input type="text" placeholder="Enter your name" name="username" autocomplete="off" required/>
<input type="number" placeholder="Enter your number" name="number" autocomplete="off" required/>
<input type="Email" placeholder="Enter your gmail" name="email" autocomplete="off" required/>
<textarea type="text" placeholder="Type Message..?" name="message" autocomplete="off" required/>
<input type="submit" value="send" class="button"/>
        </form></div>
    );
}
export default ContactForm;
